  public KeyTimesFor(letter: string) : string
  {
    var result : string = "0";
    var timeIndex = 0;
    var timeOffset = -1;

    var lastActive : boolean = true;

    for (var step of this.sequence)
    {
      if (step[0].startsWith(letter))
      {
        if (!lastActive)
        {
          if (timeOffset < 0)
          {
            timeIndex = 0;
          }

          result = result + ";" + timeIndex / this.totalDuration;
        }

        timeIndex = timeIndex + step[1];

        result = result + ";" + timeIndex / this.totalDuration;
        lastActive = true;
        timeOffset = 0;
      }
      else
      {
        lastActive = false;
        timeIndex = timeIndex + step[1];
      }
    }

    return result + ";1";
  }

  public ValuesFor(letter: string) : string
